import axios from 'axios'

const COVID_TRACKER_API = 'http://localhost:8080/covid-api/in';

class CovidTrackerService { 
    getData() {
        axios.get(COVID_TRACKER_API).then((data)=>{
            console.log(data);
            return data;
        }).catch((err)=>{
            console.log(err);
        })
    }
}

export default new CovidTrackerService();
